import useFetchData from '../customhook/userDataFetch';
import Loader from '../components/loader';
import CustomButton from '../components/customButton';
import { getUsers } from '../services/userServices';

const Home = () => {
    const { data, loading, error, refresh } = useFetchData('http://localhost:5000/product/GETALLPRODUCT');

    if (loading) return <Loader />;
    if (error) return <div>Error: {error}</div>;

    return (
        <>

            <TableContainer component={Paper}>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Name</TableCell>
                            <TableCell>Email</TableCell>
                            <TableCell>Age</TableCell>
                            <TableCell>Actions</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {data.map(user => (
                            <TableRow key={user._id}>
                                <TableCell>{user.name}</TableCell>
                                <TableCell>{user.email}</TableCell>
                                <TableCell>{user.age}</TableCell>
                                <TableCell>
                                    <CustomButton color="error" onClick={() => handleDelete(user._id)}>Delete</CustomButton>
                                </TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </>
    );
};

export default Home;
